import React from 'react'
import styled from 'styled-components'

export const Content = ({ musicData, topArtistData }) => {
  console.log('musicdata', musicData)
  console.log('topaeasodkwejfpewf', topArtistData)
  return (
    <Container>
      <Box>
        <H1>DISCOVER</H1>
        <h2>My top artists</h2>
        {/* {topArtistData.items &&
          topArtistData.items.map(artist => <p>{artist.name}</p>)} */}
        <Wrapper>
          {topArtistData.items &&
            topArtistData.items.map(artist => (
              <img
                style={{
                  width: '100px',
                  height: '100px',
                  boxShadow: '5px 5px 3px  #888888',
                  margin: '3px'
                }}
                src={artist.images[0].url}
              ></img>
            ))}
        </Wrapper>
        <h2>Based on your music-taste</h2>
      </Box>
    </Container>
  )
}

export default Content

export const Container = styled.div`
  display: flex;
  padding: 2%;
`

export const H1 = styled.h1`
  color: white;
`

export const Box = styled.div`
  display: flex;
  flex-direction: column;
`

export const Wrapper = styled.div`
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
`
